import React, { useEffect } from "react";
import "./HistoryAdmin.css";
import { useDispatch, useSelector } from "react-redux";
import { adoptinHistoryAdmin } from "../../Redux/Actions";
import DashNavBar from "../../Dashboard/Components/Dash-NavBar/Dash-NavBar";


export default function HistoryAdmin() {
  const dispatch = useDispatch();
  const history = useSelector(state => state.historyAdmin)
  console.log('historyAdmin', history)
 
  useEffect(() => {
    dispatch(adoptinHistoryAdmin());
  }, [dispatch]);



  return (
    <>
      <DashNavBar/>
      <div className="mainDashAdmin">
        <div className="adminTitulo">
          <h3>HISTORY</h3>
        </div>

        {
          !history.length ? (
            <div className="notFound-admin">
            <NotFound/>
            </div>
          ):
          <>
          {history &&
          history.map((u) => (
               <div key={Math.random()} className="favContainer">
                      <div className="favcardLeftPhoto">
                          <div className="imgFavor">
                            {u.image && (
                              <img src={u.image} alt="Pet" className="img" />
                            )}
                          </div>
                      </div>
                      <div className="favcardLeft">
                        <span>{u.name}</span>
                        <span>{u.breed}</span>
                        <span>{u.age}&nbsp;years</span>
                        <span>{u.location}</span>
                      </div>
                      <div className="favcardCenter">
                        <span>{u.gender}</span>
                        <span>{u.size}</span>
                      </div>
                      <div className="favcardRight">
                        <span>{u.description}</span>
                      </div>
                    </div>))}
          </>
        }
        
      </div>
    </>
  );
}


